import './contact.styles.scss';

const Contact = ({ active, contact }) => {
  const { username } = contact;
  console.log('active from', username, active);

  return (
    <li
      name={username}
      className={`contact-list-item ${active ? 'active' : ''}`}
    >
      {username}
    </li>
  );
};

export default Contact;
